                  "content": "\u001b[36m# Project information for page publishing\u001b[39m\r\n\u001b[36mprojectName: web-smith-demo\u001b[39m\r\n\u001b[36mprojectDesc: \"\"\u001b[39m\r\n\u001b[36mprojectLogo: \"\"\u001b[39m\r\n\u001b[36mprojectId: 3c7be939-0133-4d52-8bad-021ee546eaae\u001b[39m\r\n\u001b[36mprojectSlug: web-smith-demo\u001b[39m\r\n\u001b[36m\u001b[39m\r\n\u001b[36m# =============================================================================\u001b[39m\r\n\u001b[36m# Website Configuration\u001b[39m\r\n\u001b[36m# =============================================================================\u001b[39m\r\n\u001b[36m\u001b[39m\r\n\u001b[36m# Purpose: What's the main outcome you want readers to achieve?\u001b[39m\r\n\u001b[36m# Available options (uncomment and modify as needed):\u001b[39m\r\n\u001b[36m#   landingPage      - Landing page / Homepage: Convert visitors into users or customers\u001b[39m\r\n\u001b[36m#   ecommerce        - E-commerce / Online store: Sell products or services online\u001b[39m\r\n\u001b[36m#   portfolio        - Portfolio / Showcase: Display creative work, projects, or achievements\u001b[39m\r\n\u001b[36m#   corporate        - Corporate / Business: Professional business website with company informa"
