          value:
            - title: What kind of websites can I build?
              answer: AIGNE WebSmith is fantastic for creating landing pages, product sites,
                marketing campaigns, and documentation. It generates complete,
                multi-page websites using modern, responsive components that
                look great everywhere.
            - title: Do I need to know how to code?
              answer: You'll need to be comfortable with the command line, but no coding is
                required! The tool generates human-readable YAML for Pages Kit,
                which is super easy to understand and edit if you want to.
            - title: Is the generated content really SEO-optimized?
              answer: Absolutely! Our AI agents are trained on SEO best practices. They
                automatically generate optimized titles, meta descriptions, and
                well-structured content designed to help you rank higher.
            - title: Can I export the code?
              answer: The output is clean, component-based YAML designed for Pages Kit. This
                approach separates your content from the design, making it
                incredibly easy to manage, version, and integrate with other
                systems.
            - title: Where is my website hosted?
              answer: WebSmith publishes your site directly to the Pages Kit platform, giving
                you a seamless, integrated hosting solution and instant access
                links the moment you're done.
            - title: Just how fast is it?
              answer: It's blazing fast! You can generate a complete 5-page website in about
                2-3 minutes, and even a larger 15-page site typically takes only
                5-8 minutes. It's a total game-changer!
